import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Signup from './components/Signup'; // Adjust path as necessary
import Login from './components/Login';   // Adjust path as necessary
import Home from './components/Home.js';     // Assuming you have a Home component or a main page
import 'App.css';
const App = () => {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />       {/* Main page or landing page */}
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
